import React from "react"
import ReactDOM from "react-dom"
import "./styles.css"

function soma(a, b){
    return a+b
}

function testejsx() {
    return (
        <div className="teste">
            testando jsx
            <h1>
            soma 10 + 20 = {soma(10,20)}
            </h1>
        </div>
    )
}

const App = () => {
    return (
        <div className="App">
            {testejsx()}
        </div>
    )
}

const rootElement = document.getElementById("root")
ReactDOM.render(<App />, rootElement)
